nTemporada baja (Junio, Julio y Agosto): 20% de descuento.',NULL,NULL,4,4,0,680,200,200,100,'Anchorena 477','Buenos Aires','San Isidro','Argentina','-58.50923599999999','-34.4668418',0.00,NULL,'estricto',NULL,6,6,'2017-05-03 15:02:03','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/dOKPCy0S_ANCHORENA00.jpg',NULL,'casona-de-arquitectura-colonial'),(21,7,'Emblemática galería de estilo industrial','En pleno casco histórico, se encuentra esta hermosa galería dentro de un restaurado palacio francés que es una pieza emblemática de la ciudad. Cuenta con una exhibición de arte y una estructura industrial con excelente iluminación. Sus impecables pisos de maderas, sus sillones de cuero negro, sus alfombras y sus subdivisiones de hierro forjado y vidrio crean un ambiente de intimidad y suntuosidad. Es un buen sitio para realizar todo tipo de encuentro dentro de un marco de elegancia, distinción y calidez. Además, se permiten caterings externos. <br />\n<br />\nZona: Montserrat<br />\n<br />\n- Incluye hora de armado y desarmado.',NULL,NULL,2,2,0,0,120,120,60,'Moreno 502','CABA','Buenos Aires','Argentina','-58.3734206','-34.6113893',0.00,NULL,'flexible',NULL,6,7,'2017-05-05 22:42:04','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/8xmz7a9M_GaleriaRaggio-01.jpg',NULL,'emblematica-galeria-de-estilo-industrial'),(23,3,'Moderna casa con jardín mágico','Casa moderna ubicada a metros de la General Paz, despliega su alcance artístico a través de su estética y majestuosa dimensión. Su living invita a reconfortarse y acomodarse mientras se observan las fotografías de autor a su alrededor. Toda la instalación está pensada desde la mayor calidad estética. El jardín mágico en su área posterior, sorprende a los invitados y a todos aquellos que aspiran por la naturaleza. Ideal para organizar tus eventos.<br />\n<br />\nZona: Vicente López',NULL,NULL,4,2,0,0,280,180,100,'Gaspar Campos 1711','Buenos Aires','Vicente López','Argentina','-58.480945','-34.5199306',0.00,NULL,'moderado',NULL,6,8,'2017-05-08 23:35:19','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/2Vg0fD7S_PRUEBAGUILLE.jpg',NULL,'moderna-casa-con-jardin-magico'),(24,8,'Galpon tipo industrial','Existen múltiples variantes del texto original, algunas casi sin parecido con él. Estas versiones incluyen letras adicionales que no son comunes en latín (como la k, w y z) o palabras sin sentido como zzril, takimata y gubeergren que intentan hacer la distribución aún más parecida al inglés.<br /><br />\n<br /><br />\nVarios editores de texto proveen la funcionalidad de generación de lorem ipsum.',NULL,NULL,2,3,0,400,150,150,100,'Avenida San Martín 7438','CABA','Buenos Aires','Argentina','-58.5179137','-34.5898708',2500.00,NULL,'moderado',NULL,2,9,'2017-05-09 20:02:15','2018-01-10 19:52:57',NULL,0,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/O7N8GTM8_eventosbuenosayres_espaciosantelmo_31.jpg',NULL,'galpon-tipo-industrial'),(25,513,'Elegante departamento francés reciclado','Este departamento francés reciclado, ubicado en una de las calles más reconocidas de la Ciudad, cuenta con un elegante living, cocina remodelada y sala de música y proyección. Sus paredes son blancas pero los cuadros, objetos y decoraciones elegidos le dan el color necesario para crear una atmósfera vibrante. Es un gran sitio para realizar producciones aprovechando la excelente luz que ingresa de sus balcones franceses.<br />\n<br />\nZona: Recoleta',NULL,NULL,3,2,0,85,15,15,8,'Avenida Presidente Manuel Quintana 222','CABA','Buenos Aires','Argentina','-58.38724209999999','-34.5906314',2000.00,'https://my.matterport.com/show/?m=GgeV5Ao79qL','moderado',NULL,6,10,'2017-05-10 16:13:04','2018-06-10 15:43:31',NULL,0,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/bsUNHewJ_CasaAle-1.jpg',NULL,'elegante-departamento-frances-reciclado'),(28,11,'Galería artística y cultural','Este lugar ubicado en el artístico barrio de Palermo está compuesto por dos salas de exhibición, un auditorio y un atractivo patio. Tanto su interior como su exterior ofrecen un ambiente íntimo y relajado. Sus paredes blancas y su decoración minimalista son el marco perfecto para llevar a cabo exposiciones, workshops y conferencias donde los asistentes sean los protagonistas. Además, cuenta con servicio de seguridad y pueden utilizarse caterings externos.<br />\nUn lugar de encuentro para todo medio de expresión.<br />\n<br />\nZona: Palermo',NULL,NULL,4,2,0,0,150,150,70,'5041 Nicaragua','CABA','Buenos Aires','Argentina','-58.42888379999999','-34.585013',0.00,'https://my.matterport.com/show/?m=6UZdhUZH7KX','moderado',NULL,4,11,'2017-05-16 15:11:04','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/38j9e5sJ_MODOS00.jpg',NULL,'galeria-artistica-y-cultural'),(30,12,'Versátil y minimalista espacio palermitano','Un largo pasillo en el corazón de Palermo esconde a este espacio que se caracteriza por su estilo minimalista. Sólo decoran las paredes algunos estantes de madera y hierro y un gran ventanal hacia el fondo de la propiedad que permite el paso de la cálida luz. La simpleza se vuelve un arma poderosa que da pie a la versatilidad y creatividad. Por estos motivos, a la hora de organizar cualquier tipo de evento esta propiedad se vuelve una gran opción. <br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye hora de armado y desarmado.',NULL,NULL,2,1,0,0,40,40,18,'Gorriti 4743','CABA','Buenos Aires','Argentina','-58.4284088','-34.5910222',0.00,NULL,'moderado',NULL,6,12,'2017-05-19 16:09:55','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/JQOCciyz_upstairs01.jpg',NULL,'versatil-y-minimalista-espacio-palermitano'),(32,15,'Galpón social y performático','Espacio de experimentación, desarrollo e innovación. Todas sus salas permiten múltiples usos y transformaciones para ser adaptadas a piacere.<br />\n<br />\nZona: Palermo<br />\n<br />\nLa Hora Extra se cuenta a partir de los 15 minutos excedidos<br />\n- Incluye hora de armado y desarmado.<br />\n<br />\nAccesorios:<br />\nUtilización de proyector $400.- ARS<br />\nTécnico de Sonido $300.- ARS<br />\nTécnico de Luces $300.- ARS<br />\n',NULL,NULL,6,2,0,2,90,90,60,'1473 Arévalo','CABA','Buenos Aires','Argentina','-58.44258689999999','-34.5829618',500.00,NULL,'flexible',NULL,6,13,'2017-05-19 19:28:18','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/PCAYPzQG_IMG-20170826-WA0053.jpg',NULL,'galpon-social-y-performatico'),(33,13,'Salón de la Belle Époque reciclado','Emplazada en el tradicional barrio de Colegiales, se encuentra este antiguo salón de fiestas que fue faro cultural y social de la ciudad desde 1942, una construcción de Carlos Agote –arquitecto célebre de la historia argentina- reciclado en estudio de fotografía, arte, publicidad y moda, con terraza patio andaluz original de 1940. Ideal para todo tipo de encuentros. Esta increíble propiedad sorprende a quienes la visitan por sus amplios espacios que pueden albergar hasta a 300 personas aprox. El conservado piso de roble de Slavonia con el que cuenta la residencia, transforma al espacio en uno mucho más acogedor e íntimo. Paredes blancas, escaleras de mármol y espejos especialmente ubicados completan el magnífico escenario.<br />\n<br />\nZona: Colegiales<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\n',NULL,NULL,1,3,0,600,300,300,150,'Federico Lacroze 2963 Avenida','CABA','Buenos Aires','Argentina','-58.448116','-34.575441',0.00,NULL,'moderado',NULL,4,14,'2017-05-19 22:28:53','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/cOML4of7_prueba.jpg',NULL,'salon-de-la-belle-epoque-reciclado'),(37,13,'Rooftop Colonial','Apreciar el impactante cielo de Buenos Aires es mucho más fácil en los barrios de casas bajas como Colegiales y en esta espaciosa terraza colonial la experiencia es todavía más sublime. Esta increíble propiedad construida en 1942 por Carlos Agote (uno de los arquitectos más célebres de la historia argentina del período 1890-1942) sorprende a quienes la visitan por sus amplio espacio que pueden albergar hasta a 200 personas, entre los cuales destaca su azotea, un patio andaluz original que ha albergado producciones fotográficas para algunos de las revistas de moda más importantes del mundo como Vogue o GQ. La vista de la misma y la decoración de los azulejos coloniales la vuelven una opción perfecta para organizar cualquier tipo de cocktail o proyección.<br />\n<br />\nZona: Colegiales<br />\n<br />\n- Incluye hora de armado y desarmado.',NULL,NULL,0,3,0,300,200,200,80,'Lacroze 2963 Avenida Federico','CABA','Buenos Aires','Argentina','-58.448116','-34.575441',0.00,NULL,'moderado',NULL,6,15,'2017-05-24 16:51:15','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/5FEG1SNh_rooftopconfiteria01.jpg',NULL,'rooftop-colonial'),(38,14,'Impecable estudio en el distrito del arte','Este hermoso estudio se encuentra en el barrio de Palermo y cuenta con iluminación Led, sector de make up y un set fotográfico de 9X5 metros. Se caracteriza por sus paredes blancas y la elección de muebles, objetos y lámparas que le brindan un estilo nórdico. Es un buen lugar para realizar conferencias, lanzamientos y reuniones en un ambiente minimalista y relajado. Además, tiene una muy buena ubicación y se pueden usar caterings externos.<br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye una hora de armado y desarmado del espacio.<br />\n- Sábados y feriados se incrementa un 15% el precio.<br />\n- En producción: El precio incluye 1 metro de fondo pisado y los equipos de iluminación.',NULL,NULL,2,1,0,0,40,40,18,'4743 Gorriti','CABA','Buenos Aires','Argentina','-58.4284088','-34.5910222',0.00,'https://my.matterport.com/show/?m=7wYLdkvjM19','estricto',NULL,6,16,'2017-05-25 13:50:36','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/4yGWXVXl_JZPHOTOSTUDIO01.jpg',NULL,'impecable-estudio-en-el-distrito-del-arte'),(41,10,'Ventanales y bibliotecas que brindan calidez','Ubicado en el barrio de Palermo Hollywood, este multiespacio ofrece bar, vinería y hasta un restaurant con gastronomía de autor de alto nivel, vinos especialmente seleccionados, pastelería y panadería casera. Entre otras cosas, los detalles que caracterizan a este espacio son los amplios ventanales, las bibliotecas repletas de libros y las pequeñas luces que iluminan los ambientes. Es un lugar para el disfrute de todos los sentidos, esto junto con su gran equipamiento lo transforman en una perfecta opción para organizar todo tipo de encuentro.<br />\n<br />\nCapacidad máxima: 100 invitados<br />\n<br />\nDisponibilidad:<br />\n<br />\nLunes.........................09:00hs - 02:00hs<br />\nMartes ......................09:00hs - 02:00hs<br />\nMiércoles………………...09:00hs - 02:00hs<br />\nJueves ......................09:00hs - 02:00hs<br />\nViernes .....................09:00hs - 02:00hs<br />\nSábado .....................09:00hs - 02:00hs<br />\nDomingo....................09:00hs - 02:00hs<br />\n<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.',NULL,NULL,2,2,0,0,100,100,50,'Humboldt 1981','CABA','Buenos Aires','Argentina','-58.4327643','-34.5826848',0.00,NULL,'moderado',NULL,6,17,'2017-05-25 20:31:57','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/j7ME0SYJ_DESPENSAPAMPA-02.jpg',NULL,'ventanales-y-bibliotecas-que-brindan-calidez'),(42,10,'Multifacética galería de arte','Esta galería de arte se encuentra ubicada en el barrio de Palermo. No sólo funciona como galería sino que además se trata de una plataforma para el desarrollo de todo tipo de proyectos relacionados con la cultura. Ofrecen, además, cocina de autor y se especializan en la enología. Teniendo en cuenta estas características, este espacio es sumamente acogedor y perfecto para realizar cualquier tipo de encuentros. Además, cuenta con acceso para discapacitados.<br />\n<br />\nCapacidad máxima: 45 invitados<br />\n<br />\nDisponibilidad:<br />\n<br />\nLunes.........................09:00hs - 22:00hs<br />\nMartes ......................09:00hs - 22:00hs<br />\nMiércoles………………...09:00hs - 22:00hs<br />\nJueves ......................09:00hs - 22:00hs<br />\nViernes .....................09:00hs - 22:00hs<br />\nSábado .....................09:00hs - 22:00hs<br />\nDomingo....................09:00hs - 22:00hs<br />\n<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.',NULL,NULL,2,2,0,0,45,45,22,'Humboldt 1981','CABA','Buenos Aires','Argentina','-58.4327643','-34.5826848',0.00,NULL,'moderado',NULL,6,18,'2017-05-25 22:41:55','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/OGHmNUey_GALERIAQUIMERA01.jpg',NULL,'multifacetica-galeria-de-arte'),(44,16,'Rooftop único en el casco histórico porteño','Salón privado, ideal para todo tipo de eventos. Moderno, ubicado en el casco histórico porteño, combina diseño, tecnología y estilo de autor.  <br />\nPragmático, ideal tanto para bodas y festejos varios, como para cenas a puertas cerradas, jornadas laborales, cocktails, muestras de arte.<br />\nCreado para vivirlo con intensidad, la sala comprende el salón principal con salón de bar, dos barras, una interna y otra externa, una amplia terraza con pileta y vista a la cúpula de San Francisco de Asís, baños individuales, un sector de recepción, un extenso balcón, y una cocina profesional.<br />\n El lugar ofrece sonido regulable y música ambiental, luces dimerizables y lámparas, dos proyectores con pantallas, sofás, sillones, sillas y mesas. Ambiente climatizado, wifi y tv digital, así como un responsable de sala presente durante todo el evento y personal de limpieza. <br />\nDisponibilidad producciones: Domingos, Lunes y Martes\n<br />\n<br />\nZona: San Telmo<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\n- Existe una atención por eventos diurnos.\n<br />\nNo se encuentra incluido costo del menú, packs, de vino, barra, mobiliario adicional.<br />\nEn el caso que sean más de 16 personas en la parte técnica solicitamos un cheque por valor de $20.000 en concepto de posibles daños o rupturas que será devuelto al finalizar la jornada, después de verificar que la sala se encuentra en el mismo estado en que se entregó. \n','- Los horarios acordados deben ser respetados.\n- Está prohibida la venta de alcohol.\n- No se permite catering externo.\n- Sólo está permitido fumar en el exterior\n- Ocúpese de respetar y no dañar el espacio, mobiliario y el equipamiento. Cualquier pérdida o daño podría suponer una deducción sobre el depósito de seguridad.\n- Avisar al anfitrión si surgen cambios de acuerdo a lo pactado.\n',NULL,3,4,0,0,150,150,90,'273 Defensa','CABA','Buenos Aires','Argentina','-58.37200869999999','-34.6109877',0.00,NULL,'estricto',NULL,6,19,'2017-05-26 15:34:23','2018-02-16 15:01:18',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/EHBOUYUm_PISOTRES-01.jpg','+541163569635','rooftop-unico-en-el-casco-historico-porteno'),(45,20,'Realismo Mágico en restaurant industrial','Este lugar es ideal para realizar producciones, pop ups, exposiciones de arte y demás eventos íntimos por la riqueza de su decoración, producto de la mezcla entre el concepto industrial y vintage. Sus paredes de ladrillos descubiertos y sus objetos de colección generan una atmósfera única, que se complementa con la iluminación tenue e íntima. El propietario genera atmósferas irrepetibles a través de su realismo mágico.<br />\n<br />\nZona: San Telmo<br />\n<br />\n*Producciones sin autos. Si se llegan a utilizar tienen un adicional al precio.<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.',NULL,NULL,4,2,0,0,100,100,50,'Avenida Caseros 461','CABA','Buenos Aires