iendo uso también de su escenario y de los palcos. Además, cuenta con un servicio de seguridad, guardarropas y un gran servicio de sonido e iluminación.<br />\nSu capacidad máxima en formato de auditorio es de 500 personas y 320 en cenas formales. No existe alquiler de media jornada.\n<br />\n<br />\nZona: San Nicolás<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.<br />','- Los horarios acordados deben ser respetados.\n- Está prohibida la venta de alcohol.\n- No pueden ingresar Caterings externos.\n- Ocúpese de respetar y de no dañar el espacio, el mobiliario y el equipamiento. Cualquier pérdida o daño podría suponer una deducción sobre el depósito de seguridad.\n- Avisar al anfitrión si surgen cambios de acuerdo a lo pactado.',NULL,4,2,0,700,500,500,250,'Florida 164','CABA','Buenos Aires','Argentina','-58.375134','-34.606164',8000.00,NULL,'estricto',NULL,8,26,'2017-05-29 17:59:11','2018-03-07 21:24:54',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/8M8MHJys_TeatroAstor-01.jpg',NULL,'hermoso-teatro-clasico-simbolo-de-la-elegancia'),(52,23,'Viaje al pasado en antigua casona','Esta antigua propiedad que asemeja a un conventillo tiene varios espacios interiores como exteriores. Con sus paredes despintadas, puertas antiguas de gran altura, vidrios de colores en los ventanales y escaleras en forma de caracol, este edificio es un viaje sin escalas al pasado. Es el perfecto escenario para filmaciones, sesiones de fotos, reuniones y pop-ups que busquen un ambiente de antaño y un claro paso del tiempo. Un edificio cuyo diseño y fachada es un personaje en sí mismo.  <br />\n<br />\nZona: Villa Crespo',NULL,NULL,10,1,0,600,100,100,50,'Corrientes 6067 Avenida','CABA','Buenos Aires','Argentina','-58.4463525','-34.5928684',0.00,NULL,'flexible',NULL,6,27,'2017-05-31 18:50:11','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/dqzMRCES_lallavi-01.jpg',NULL,'viaje-al-pasado-en-antigua-casona'),(53,33,'Ph reciclado bohemio','Casa antigua reciclada con patio y terraza. Tiene una cocina amplia, con un comedor y un living con decoración musical. Dos Baños y Dormitorio. Un espacio íntimo y despojado para todo tipo de evento.<br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\n- No se aceptan producciones televisivas.<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.',NULL,NULL,3,2,0,0,20,20,10,'Gorriti 5663','CABA','Buenos Aires','Argentina','-58.4377702','-34.584319',0.00,NULL,'moderado',NULL,6,28,'2017-05-31 21:11:42','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/VhQN7eOb_Tomasberberian-01.jpg',NULL,'ph-reciclado-bohemio'),(54,34,'Un místico jardín con inigualable estética ','El lugar nace en un casa emplazada en Bajo Belgrano con un místico jardín y una inigualable estética. Ofrece la posibilidad de realizar una gran variedad de eventos en una localidad de suma tranquilidad y fácil acceso en medio de la ciudad. Se puede adaptar a cualquier tipo de evento gracias a sus muebles y sus amplios y cómodos espacios.<br />\n<br />\nZona: Belgrano<br />\n<br />\nEl precio no incluye: seguridad, limpieza, daños (se cobrará el 100%) y/o servicios extras<br />\n<br />\n*Los valores expresados se verán reducidos por jornada completa.<br />\n<br />\nPolítica de cancelación pautada y, en caso de haberlos, gastos de organización de muebles, etc.<br />\n',NULL,NULL,2,3,0,0,300,300,200,'Ramsay 2424','CABA','Buenos Aires','Argentina','-58.44254789999999','-34.54902939999999',7000.00,NULL,'flexible',NULL,6,29,'2017-06-01 17:53:49','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/PLsRhQE5_ELSOTANO-00.jpg',NULL,'un-mistico-jardin-con-inigualable-estetica'),(55,35,'Íntimo y cálido ambiente','Este lugar muy bien ubicado en el corazón del barrio de Palermo, cuenta con una acogedora sala de estar muy bien equipada para eventos íntimos. Sus diferentes áreas decoradas con detalles en madera y colores en tonalidades tierra, se conectan a través de un patio interno, lo que le brinda un toque especial y apacible. <br />\n<br />\nEste cómodo e impecable espacio brinda la privacidad justa para realizar eventos sociales, corporativos y cocktails de carácter reservado. Además su fácil acceso brinda un valor agregado a los asistentes.<br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye hora de armado y desarmado.',NULL,NULL,4,2,0,0,30,30,15,'Charcas 5258','CABA','Buenos Aires','Argentina','-58.43167640000001','-34.5773839',0.00,NULL,'flexible',NULL,6,30,'2017-06-02 23:08:58','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/yKYqdsn9_LaHuertaCoworking-00.jpg',NULL,'intimo-y-calido-ambiente'),(56,379,'Versátil y amplio salón en el corazón de Recoleta','Esta edificación presenta particularidades arquitectónicas únicas por su dimensión, altura, amplitud y concepción. Se divide en 2 niveles que cuentan con barras, espacios vip y salón privado. <br />\n<br />\nZona: Recoleta<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.',NULL,NULL,5,2,0,1000,600,600,300,'Avenida Juan Bautista Alberdi 2501','CABA','Buenos Aires','Argentina','-58.39279899999999','-34.5862489',10000.00,NULL,'estricto',NULL,6,31,'2017-06-02 23:28:32','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/dUd7Trlx_Salonauditorio-04.jpg',NULL,'versatil-y-amplio-salon-en-el-corazon-de-recoleta'),(57,36,'Casona reciclada con fantástica terraza','Casa antigua reciclada en pleno Palermo con sala de reunión, oficinas privadas y compartidas, estudio de foto y video y una terraza a cielo abierto llena de plantas. La ubicación es una de sus principales ventajas: subte a una cuadra, líneas de colectivos muy cerca, estación de tren y varios estacionamientos en los alrededores.<br />\n<br />\nZona: Palermo',NULL,NULL,3,1,0,110,40,40,25,'Thames 2409','CABA','Buenos Aires','Argentina','-58.42276760000001','-34.5819986',0.00,NULL,'moderado',NULL,6,32,'2017-06-02 23:54:03','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/Lr2Qyuyv_IndusCoworking-00.jpg',NULL,'casona-reciclada-con-fantastica-terraza'),(58,37,'Histórico bodegón con estilo rústico','Este bodegón de antaño, ubicado en San Telmo, tiene un ambiente rústico y parece haberse quedado congelado en el tiempo. Cuenta con pisos al estilo de un tablero de ajedrez, paredes aguamarina repletas de cuadros y posters de épocas pasadas, varios ventanales y una hermosa subdivisión hecha con vidrios de colores. Pueden aprovecharse sus amplios espacios, aloja hasta 150 personas, y su atmósfera más relajada para organizar muestras de arte y diversos pop-ups. Además, se permite el uso de caterings externos. <br />\n<br />\nZona: San Telmo',NULL,NULL,2,2,0,0,150,150,75,'Bolívar 1778','CABA','Buenos Aires','Argentina','-58.3721061','-34.6289904',0.00,NULL,'flexible',NULL,6,33,'2017-06-03 00:26:25','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/9T7KJqMF_ViejoVulcano-01.jpg',NULL,'historico-bodegon-con-estilo-rustico'),(59,20,'Espacio inmerso en objetos de colección','Este lugar es ideal para realizar producciones, pop ups, exposiciones de arte y demás actividades íntimas por la riqueza de su decoración y objetos de colección, producto de la mezcla entre el concepto industrial y vintage. Sus paredes de ladrillos descubiertos y pisos de madera generan una atmósfera única, que se complementa con la abundante luz natural de la que dispone. <br />\n<br />\nZona: San Telmo<br />\n<br />\n*Preci