 caso de extensión de horas de uso, se fracciona cada hora.<br />\n-Seguridad no incluida.','- Los horarios acordados deben ser respetados.\n- No se permiten menores de 18 años.\n- Está prohibida la venta de alcohol\n- No se permiten fiestas o música fuerte.\n- No pueden ingresar Caterings externos.\n- Solo está permitido fumar en el exterior.\n- Ocúpese de respetar y de no dañar el espacio, el mobiliario y el equipamiento. Cualquier pérdida o daño podría suponer una deducción sobre el depósito de seguridad.\n- Avisar al anfitrión si surgen cambios de acuerdo a lo pactado.',NULL,3,2,0,80,100,100,70,'José Antonio Cabrera 4625','CABA','Buenos Aires','Argentina','-58.4283728','-34.5926183',2000.00,NULL,'flexible',NULL,8,36,'2017-06-05 15:00:32','2018-06-07 17:27:11',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/PmeHuq8g_AsociacionDrusa-02.jpg',NULL,'impecable-y-amplio-salon-institucional'),(62,40,'Sala multidisciplinaria artística y cultural','Con sus paredes llenas de colores y dibujos, la gran diversidad de espacios y su ambiente distendido, este lugar es una gran opción para realizar conferencias, lanzamientos y otro tipo de encuentro a nivel masivo, aprovechando su infraestructura y potencial cultural multidisciplinario.<br />\n<br />\nZona: Villa Crespo<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\nSe cotiza aparte técnica, servicio de catering,  servicio de barra libre, proyector, sonido y puesta de luces, shows en vivo, entre otros. ',NULL,NULL,2,2,0,0,350,350,170,'Pringles 1249','CABA','Buenos Aires','Argentina','-58.426233','-34.597356',0.00,NULL,'estricto',NULL,6,37,'2017-06-05 15:35:02','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/6ZYANiKl_ClubCulturalMatienzo-01.jpg',NULL,'sala-multidisciplinaria-artistica-y-cultural'),(63,41,'Acogedora casa y atractivo patio','Esta casa, ubicada en el barrio de Chacarita, cuenta con un pintoresco patio decorado con varias plantas y pequeños árboles en distintas tonalidades de verde que generan un ambiente cálido. En su interior hay un acogedor living con sillones, mesas y sillas. Sus paredes son blancas pero los cuadros, objetos y decoraciones elegidos le dan el color necesario para crear una atmósfera vibrante. Es un gran sitio para realizar eventos como cocktails sociales y corporativos aprovechando su patio durante el buen clima como también su interior y lograr brindarles a los asistentes un entorno distendido.<br />\n<br />\nZona: Chacarita',NULL,NULL,4,2,0,0,45,45,20,'Giribone 947','CABA','Buenos Aires','Argentina','-58.45615840000001','-34.5801766',0.00,NULL,'moderado',NULL,6,38,'2017-06-05 17:58:38','2018-01-10 19:52:57',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/CG4RF1aX_CasaFelix-01.jpg',NULL,'acogedora-casa-y-atractivo-patio'),(64,39,'Espacio multidisciplinario artístico','Este atractivo salón institucional con pisos revestidos de madera e impecables paredes blancas con paneles de pana turquesa se encuentra en el atractivo barrio de Palermo. Cuenta con una capacidad para 50 personas y percheros. El espacio es flexible lo que permite que sea usado tanto para una clase de yoga como para una reunión descontracté. Además, tiene wi-fi y pueden utilizarse caterings externos.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Limpieza del salón NO incluida en caso de eventos con uso de cocina.<br />\n-Precio para sábados +20% <br />\n-En caso de extensión de horas de uso, se fracciona cada hora.<br />\n-Seguridad no incluida<br />\n',NULL,NULL,2,2,0,80,50,50,20,'José Antonio Cabrera 4625','CABA','Buenos Aires','Argentina','-58.4283728','-34.5926183',2000.00,NULL,'flexible',NULL,6,39,'2017-06-05 18:38:42','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/94eaClyo_AsociacionDrusa1erpiso-01.jpg',NULL,'espacio-multidisciplinario-artistico'),(65,42,'Hermosa casa antigua bien ubicada','Esta casa antigua, con perfecta ubicación de muy fácil acceso, 