permite servir de lienzo a la hora de poner en marcha la creatividad, por lo que es ideal para realizar filmaciones, sesiones de fotografía y producciones en general. <br />\n<br />\nZona: Belgrano<br />\n<br />\nAdicionales: <br />\n 5 Flashes Prometh:<br />\n(3) E600w / (1) E800w / (1) HD1200w<br />\n– Peribounce<br />\n– 2 Cajas de luz 90x120cm (con aro adaptador)<br />\n– 1 reflector 5 en 1<br />\n– 1 reflector 7 en 1<br />\n– 4 pies de iluminación<br />\n– 1 Paraguas blanco<br />\n– 1 Paraguas translúcido<br />\n– 1 Paraguas dorado<br />\n– 2 Cacerolas 18cm<br />\n– 2 Cacerola 16cm<br />\n– 1 Mesa de Producto<br />\n– 1 Beauty Dish plateado 70cm<br />\n– 1 Portafondo Portátil<br />\n– 1 Snoot<br />\n– Nido de abeja<br />\n– 2 Backlight<br />\n– 1 Barndoor<br />\n– 1 Juego de filtros 7 colores<br />\n– 1 Jirafa con manija<br />\n– 3 Fondos (blanco – negro – gris)<br />\n– No se cobra el metro pisado –<br />\n– 1 Fotómetro SEKONIC<br />\n– 1 Transmisor<br />\n– 4 Receptores<br />\n',NULL,NULL,3,2,0,0,60,60,30,'Avenida Federico Lacroze 2120','CABA','Buenos Aires','Argentina','-58.44229439999999','-34.5674579',0.00,NULL,'moderado',NULL,6,43,'2017-06-21 22:56:39','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/E7JbOkft_prometh-01.jpg',NULL,'inmaculado-estudio-con-patio'),(69,48,'Espacio multimedial listo para contar tu historia','Este edificio cuenta con seis áreas bien definidas entre sí, cada una con su propio concepto, estética y comodidades. Este espacio ofrece múltiples alternativas en sus 5.000m2 cubiertos y sus 2.000m2 de terrazas equipadas. Su minimalismo, su variedad de espacios y la flexibilidad del lugar ofrece una gran libertad a la hora de delimitar sectores y aprovechar su tamaño para llevar a cabo conferencias, reuniones, workshops, entre otras actividades. Además, cuenta con wi-fi, baños y ascensor y se aceptan caterings externos.<br />\n<br />\nEl Estudio I es una planta de 900m2, con una altura de 17m<br />\nParrilla operable en toda la superficie a 12m de la base<br />\nSala de vestuario / Sala de maquillaje y pelo / Bar/ Comedor + cocina industrial<br />\nIngreso de vehículos en el set mediante entrada de camión con dársena de descarga para pala hidráulica<br />\nTecho corredizo para ingreso de luz natural<br />\nBar/barra / Comedor + cocina industrial<br />\n4 baños y duchas en la planta del estudio / Baños públicos con gabinete de seguridad<br />\nEspacio de living con Wi-Fi / Acceso a patio 200m2 para expansión <br />\nEspacio interno y cubierto para generador<br />\n<br />\nZona: Villa Crespo',NULL,NULL,0,4,0,900,500,500,400,'Cucha Cucha 1661','CABA','Buenos Aires','Argentina','-58.45482879999999','-34.60387290000001',0.00,NULL,'moderado',NULL,6,44,'2017-06-22 00:11:55','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/GgDWQxDf_BSEstudio01-01.jpg',NULL,'espacio-multimedial-listo-para-contar-tu-historia'),(70,48,'Espacio industrial artístico y versátil','Espacio de 400 m2 con techo de vidrio que permite el ingreso de luz natural. Cuenta con tres accesos, dos escaleras y un montacargas.<br />\nSu minimalismo y flexibilidad ofrece una gran libertad a la hora de delimitar sectores y aprovechar su tamaño para llevar a cabo producciones, eventos, entre otras actividades. <br />\nRecepción y entrada independiente / Sala de vestuario / Sala de maquillaje y pelo / Cocina y comedor / 2 baños con ducha <br />\n<br />\nZona: Villa Crespo',NULL,NULL,0,2,0,250,60,60,40,'Cucha Cucha 1661','CABA','Buenos Aires','Argentina','-58.45482879999999','-34.60387290000001',0.00,NULL,'moderado',NULL,6,45,'2017-06-22 18:59:16','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/aALOVj3k_BSBasement-05.jpg',NULL,'espacio-industrial-artistico-y-versatil'),(73,48,'Rooftop versátil y creativo ','Su estética brutal, su variedad de espacios, el hormigón a la vista y la flexibilidad del lugar lo que ofrece una gran libe