ía: 50% del valor del arriendo.<br />\n<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.',NULL,NULL,2,2,0,200,120,120,45,'Libertad 50','Buenos Aires','Benavidez','Argentina','-58.73006600000001','-34.4066275',0.00,NULL,'moderado',NULL,6,47,'2017-06-24 00:09:22','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/toBtBZeg_Torrepueblo-01.jpg',NULL,'una-villa-italiana-en-buenos-aires'),(75,50,'Imponente salón con estilo propio de campo','Una añosa arboleda de eucaliptus y un espejo de agua con fauna autóctona dan marco a una imponente construcción de estilo criollo, especialmente proyectado y diseñado para eventos corporativos o sociales ligados a este entorno tan particular.<br />\nEn una superficie total cubierta de 700 m2 contamos con una recepción, salon principal con doble altura, una gran parrilla cubierta y amplias galerías donde la mirada se pierde sin encontrar su limite.<br />\nLa construcción del salon permite multiples disposiciones, y diferentes tipos de ambientación, con el paisaje de la pampa como escenario principal.<br />\n<br />\nZona: Arrecifes<br />\n<br />\n- Costo aparte: Estadía en la estancia por dos días y una noche hasta 27 personas.<br />\n',NULL,NULL,2,6,0,700,400,400,250,NULL,'Buenos Aires','Arrecifes','Argentina','-60.1024864','-34.0591955',0.00,NULL,'estricto',NULL,6,48,'2017-06-25 01:45:59','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/GNAmhDpO_ElSosiego-00.jpg',NULL,'imponente-salon-con-estilo-propio-de-campo'),(76,51,'Excelente ambiente de desconexión creativa','El lugar está dividido en dos íntimos estudios, muy bien equipados, con pisos de madera y decorados con un estilo sobrio que evoca un clima calmo e inspirador. <br />\nA los estudios se suma una amplia área de recreación, cuyas paredes ostentan colores vivos y cuenta con tenis de mesa y pool, expendedora de café, té, microondas y heladera