o de eventos. Ofrecemos un excelente servicio gastronómico, con personal altamente calificado, ya sea para  reuniones de grupos pequeños, grandes; conferencias, congresos, exposiciones, ferias y  diferentes tipos de eventos corporativos y sociales en un espacio que no se parece al resto de los salones tradicionales. Sus grandísimas dimensiones les permitirán celebrar una fiesta por todo lo alto y llenarla de detalles propios, como música en vivo con mucho, pero mucho baile. Nuestro lugar es uno de los más importantes del  país en su tipo; totalizando 2 salones principales con capacidad de hasta 2000 personas, más 3  espacios complementarios, espacio indoor y estacionamiento con acceso directo a los salones.<br />\nNos comprometemos a acompañarlo con la mayor eficiencia y calidez a fin que su reunión y  estadía sean placenteras.<br />\n',NULL,NULL,6,5,0,2100,2100,2100,800,'Pueyrredón 2501 Avenida','CABA','Buenos Aires','Argentina','-58.39279899999999','-34.5862489',10.00,NULL,'estricto',NULL,4,187,'2017-10-29 16:32:31','2018-01-10 19:52:58',NULL,0,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/ankRwSfb_IMG_2941.JPG',NULL,'centro-de-convenciones-sociales-y-corporativos'),(232,395,'1509414472805','',NULL,NULL,6,3,0,4,50,0,0,'Paraguay 3230','Buenos Aires','Benavidez','Argentina','-58.7146507','-34.4213301',0.00,NULL,NULL,NULL,2,188,'2017-10-31 01:47:35','2018-01-10 19:52:58',NULL,0,NULL,NULL,'1509414472805'),(233,405,'Jardín oculto en Libertador y Salguero','Encantador jardín en plena zona comercial, con fácil acceso. Este espacio multidisciplinario es ideal  para meditar, conversar y presentar alguna pequeña exposición. <br />\n<br />\nZona: Palermo',NULL,NULL,4,2,0,0,30,30,20,'Juan Francisco Seguí 3554','CABA','Buenos Aires','Argentina','-58.4086995','-34.5793684',2000.00,NULL,'flexible',NULL,6,189,'2017-11-01 19:47:54','2018-01-10 19:52:58',NULL,1,'https://res.cloudinary.com/wimet/image/upload/fotosespacios/SQXvPqUv_bosque.jpg',NULL,'jardin-oculto-en-li