racias!\nRosario.',1,0,'2018-01-30 18:59:47',NULL),(479,222,524,'Micaela, buenas tardes!\nNecesito la cotización de Piso 3 para realizar un evento el lunes 12 de marzo. Necesitaría una pantalla y sonido.\nAdemás, necesito sillas para 60 personas en auditorio preferentemente.\nHabría que cotizar desayuno, almuerzo y coffee brake.\nTienen disponibilidad? Cómo se llama el salón?\nGracias!\nRosario.',1,0,'2018-01-30 19:02:05',NULL),(480,223,524,'Gabriel, buenas tardes!\nNecesito la cotización del lugar para realizar un evento el lunes 12 de marzo. Necesitaría una pantalla y sonido.\nAdemás, necesito sillas para 60 personas en auditorio preferentemente.\nHabría que cotizar desayuno, almuerzo y coffee brake.\nTienen disponibilidad? Cómo se llama el salón?\nGracias!\nRosario.',1,0,'2018-01-30 19:10:42',NULL),(481,224,524,'Daniela, buenas tardes!\nNecesito la cotización del salón para realizar un evento el lunes 12 de marzo. Necesitaría una pantalla y sonido.\nAdemás, necesito sillas para 60 personas en auditorio preferentemente.\nHabría que cotizar desayuno, almuerzo y coffee brake.\nTienen disponibilidad? Cómo se llama el salón?\nGracias!\nRosario.',1,0,'2018-01-30 19:12:13',NULL),(482,214,15,'Hola Laura! Como estas?Genial, si, el formato tal y como lo contas puede realizarse aqui.Te contamos, el equipamiento con el que cuentan es de Consola de Sonido + Cajas + MICROFONO con pie y cable + Planta de luces base Led. El Proyector tiene un valor extra de $350 (deben traer notebook + operador si es que precisan)Con respecto al Coffee Break podemos hablar con dos emprendiemientos que trabajan con nosotros (CHEKA y Chimeneas) y te enviamos que opciones tienen. En caso que vos quieras organizarlo, aqui contas con cocina y bara de expendio.Si queres pasar a conocer el Espacio, te esperamos en Arevalo 1473 (Palermo). Escribinos por whatsapp para coordinar, nuestro numero es +**********.Saludos, Agustina',1,0,'2018-01-30 19:17:47','2018-02-09 19:15:25'),(483,215,14,'Hola Laura, cómo estás?\nGracias por contactarte con nosotros.\n\nJota Zeta Studio es un estudio fotográfico en donde además se dictan workshops y charlas.\nContamos con equipos profesionales de iluminación y fondos fotográficos.\nEl proyector es opcional y cuesta $800 el alquiler por jornada.\n\nPor lo general, cada equipo de trabajo trae su propio catering y vajilla.\nNosotros contamos con cocina, heladera, horno y pava eléctrica. \nAdemás el estudio cuenta con una parte al exterior, como se ve en la fotografía.\nHay 3 mesas de 2x1mts y contamos con 10 sillas.\n\nEn varias oportunidades se alquilan mobiliarios o solamente sillas en caso de ser necesario.\nEl ambiente estas climatizado con aire frío/calor.\n\nSobre tu propuesta, no habría problema en organizar 1 encuentro por mes a partir de las 18hs.\nEl ciclo de charlas mensuales sobre qué trata?\n\nAguardo tu respuesta.\nGracias nuevamente por contactarte.\n\nSaludos,\n\nJesica Zayat.\n\n',1,0,'2018-01-30 20:18:09','2018-01-30 20:18:09'),(484,216,39,'Hola Laura ! Mucho gusto. Mi nombre es Julieta y colaboro en la institucion a donde pertenece el salon publicado. \nEse dia y en ese horario el salon esta disponible por el momento. Contamos con proyector, pantalla, microfono y parlantes. El uso del sonido tiene un costo adicional al valor del uso del salon. (se cobra $ 500 cuando es evento por unica vez, en tu caso podemos pensar en otro valor)\nNuestro salon cuenta con cocina y heladera. Hasta el momento ofrecemos solamente el salon y sus instalaciones, pero podriamos pensar en ofrecer el servicio de coffe break (permitime analizarlo y te respondo en breve). Nuestro salon y nosotros somos muy calidos y el clima es muy familiar. Seguro se sentiran como en su casa !\nSi te parece coordinamos un dia para que vengan a conocerlo.\nOjala les sirva a su proposito nuestro salon !\nun cariño,\n\nJulieta\n',1,0,'2018-01-30 20:37:27','2018-01-30 20:37:27'),(485,216,523,'Hola Julieta, gracias por tu respuesta.\nComo podemos hacer para coordi