cio de la terraza durante todo el dia o por la noche el sabado 24/2, con motivo de festejar mi cumpleaños de 30. Es una fiesta tranquila con familia y amigos ya que estoy embarazada. Se puede ir a ver ir a ver el lugar? \nGracias!\nJulieta ',1,0,'2018-02-11 15:49:02',NULL),(528,238,532,'Hola! Quisiera saber cuantas horas incluye el espacio por 1 dia o por media jornada. Mi intenciòn es festejar mi cumpleaños de 30, hacer algo tranquilo con familia y amigos porque estoy embarazada. \nGracias!\nJulieta',1,0,'2018-02-11 15:56:16',NULL),(529,238,532,'',0,0,'2018-02-11 15:57:16','2018-02-11 15:57:16'),(530,235,395,'Perdón Victoria, te corrijo el horario de media jornada de mañana es de 8 a 14 hs.\nConfírmame. Gracias',0,0,'2018-02-12 00:36:03','2018-02-12 00:36:03'),(531,238,395,'Hola Julieta, el 24 de febrero la casa esta alquilada.\nLa media jornada sería de 10 a 15 hs o 17 a 22 hs  (es estimado, se puede conversar). \nJornada completa sería de 10 a 20 hs.\nLa cantidad máxima de personas son 25. \nNo se puede hacer \"fiesta\" de música fuerte, ya que tiene las normas de casa residencial, respetando a los vecinos. \nEspero tu respuesta, saludos\nPía',0,0,'2018-02-12 00:42:36','2018-02-12 00:42:36'),(532,235,395,'Hola Victoria, necesitaría confirmación para la producción del viernes. Gracias',0,0,'2018-02-14 00:54:54','2018-02-14 00:54:54'),(533,234,281,'Hola Victoria, buenos dias!\nSi claro, puede ser por la mañana sin problemas, por el momento la cotización se mantiene igual para media jornada, ya que bloqueamos el espacio por todo el dia!\nAvisame si queres venir a conocer la terraza y lo coordinamos.\nSaludos!',0,0,'2018-02-14 14:17:44','2018-02-14 14:17:44'),(534,237,281,'Hola Julieta, buenas tardes!\n\nSi claro, podes acercarte a conocerlo! Estamos en Didí Rooms, podes encontrar nuestros datos en la web de Daiban Hotels, y en caso de estar interesada podes reservar por este medio. Saludos!',0,0,'2018-02-14 16:41:21','2018-02-14 16:41:21'),(535,239,534,'Estamos interesados en realizar un evento de presentación de Cabify para potenciales conductores. El mismo consistirá en una serie de presentaciones respecto a la aplicación y a la empresa. También se realizará un Sorteo para los participantes. \n\nEl evento dispondrá de una recepción al inicio del evento y luego 2 horas de presentación. Al finalizar las presentaciones se realizará el alta de usuarios a la plataforma y luego finalizará con el sorteo de premios. \n\nQuisiéramos realizar un presupuesto para el alquiler del local de 18:30 a 22hs. \n\nEl mismo deberá incluir el detalle de: \n- Alquiler de salon (contemplando mobiliario y equipos para presentación)\n- Catering (tanto para la recepción, como refrigerios luego de las presentaciones)\n- Estacionamiento \n\nQuedo a a la espera de su respuesta \n',1,0,'2018-02-14 18:04:34',NULL),(536,240,534,'Estamos interesados en realizar un evento de presentación de Cabify para potenciales conductores. El mismo consistirá en una serie de presentaciones respecto a la aplicación y a la empresa. También se realizará un Sorteo para los participantes. \n\nEl evento dispondrá de una recepción al inicio del evento y luego 2 horas de presentación. Al finalizar las presentaciones se realizará el alta de usuarios a la plataforma y luego finalizará con el sorteo de premios. \n\nQuisiéramos realizar un presupuesto para el alquiler del local de 18:30 a 22hs. \n\nEl mismo deberá incluir el detalle de: \n- Alquiler de salon (contemplando mobiliario y equipos para presentación)\n- Catering (tanto para la recepción, como refrigerios luego de las presentaciones)\n- Estacionamiento \n\nQuedo a a la espera de su respuesta \n',1,0,'2018-02-14 18:05:45',NULL),(537,233,530,'Buenas! sigo esperando la respuesta para poder ir a visitar la locación. Quedo a disposición, Saludos!',0,0,'2018-02-14 20:54:20','2018-02-14 20:54:20'),(538,234,531,'Hola Marina! Te podré pedir un mail personal? La coordinación de la fecha de producción y la visita previa quisiera arreglarla la directora del emprendimiento de ser posible. Gracias!',0,0,'2018-02-15 15:21:07','2018-02-15 15:21:07'),(539,234,281,'Hola Victoria!\nLas politicas de wimet no me permiten enviarte contacto directo, pero puedes encontrar mas info en la web de Daiban Hotels para poder coordinar una visita y que conozcas el espacio!\n\nSaludos,',0,0,'2018-02-15 15:52:39','2018-02-15 15:52:39'),(540,241,513,'Hola Pato!\nEstoy probando porque no te llegan los mensajes.\nAvisame si lo ves.\nAbrazo,\n\nAle',1,0,'2018-02-15 17:44:41',NULL),(541,242,17,'niedneid',1,0,'2018-02-15 18:07:37',NULL),(542,237,532,'Podre ir a verlo hoy o mañana? Me pasas ma direccion exacta por favor?',0,0,'2018-02-16 15:25:31','2018-02-16 15:25:31'),(543,237,281,'Hola Julieta, buenos días. \nSi claro, poder acercarte y en nuestra recepción quien se encuentre te acompañará a conocer el espacio.\nPodes hacer click en \"obtener datos\" para recibir nuestra info!\nSaludos,',0,0,'2018-02-16 16:13:45','2018-02-16 16:13:45'),(544,240,503,'Hola Santiago, \nMuchas gracias por tu contacto. Mi nombre es Teresita Te pido disculpas pero me encuentro de vacaciones en este momento hasta el 27 de febrero inclusive.  En ese horario podemos ofrecerte el Café Triunfal. Como auditorio podemos ubicar aprox con muy buena visibilidad unas 250/280 personas. El salón tiene un costo de $ 15.000 + iva por esas horas. Adicionalmente por alquiler de pantalla, proyector y micrófono $ 1.000+iva por cada uno más un técnico $ 1.500. Están incluidos las sillas y mesas de apoyo que necesiten para acreditación. No necesitan ambientación ya que el salón cuenta con un estilo elegante y de época. \nRespecto al servicio de catering me gustaría que me indiques que necesitarías. Un servicio de cafetería (te, cafe, aguas, y fingers dulces) ronda los $ 95 + iva) En el caso de de un cocktail el precio puede rondar entre $ 500 a $ 600 + iva.  \nEl Teatro cuenta con una capacidad de 500 personas como auditorio pero en ese horario tenemos cenas shows todos los días por lo cual el costo estimo que se elevaría muchísimo. \nSi necesitás un presupuesto formal te lo estaría enviando en unos días. \nSaludos\n',0,0,'2018-02-17 11:25:00','2018-02-17 11:25:00'),(545,177,503,'Hola Victor.\nTe pudo dilcupas pero este mensaje no había sido recepcionado por nosotros. Mi nombre es Teresita. En este momento estoy de vacaciones hasta el 27 de febrero.  El Teatro en ese horario brinda cenas shows de tango. Te puedo ofrecer el Café Triunfal con capacidad para auditorio de 250 personas. Tiene escenario y todo el equipamiento disponible para realizar clases. Si aún estás en la búsqueda necesitaría consultar disponibilidad y con tu ok te enviaría un presupuesto. \nSaludos.\n',0,0,'2018-02-17 11:30:52','2018-02-17 11:30:52'),(546,240,534,'Hola! \n\nAntes que nada muchas gracias por toda la información. Por lo que entiendo nosotros deberíamos estar alquilando el Cafe Triunfal y utilizar tipo auditorio. Esto tendría un costo de:\n- $15.000 + IVA (Espacio)\n- $1.000 + IVA (Proyector + Micrófono)\n- $1.500 + IVA (Técnico)\n\nCon respecto al servicio de Catering el precio que me estas indicando es por persona ¿Verdad?. En caso de que  fuera cocktail que estaría incluido en esto.\n\nPor último quisiera consultarte si dentro del espacio se incluye estacionamiento para los asistentes. Y en caso de que no sea así cuanto costaría incluirlo durante estas 3 horas. \n\nQuedo a la espera \n\n¡Muchas Gracias! ',0,0,'2018-02-19 18:02:17','2018-02-19 18:02:17'),(547,243,539,'Hola, mi nombre es Priscila, trabajo con producción de eventos en Brasil. Haré un evento en Buenos Aires y me gustaría saber más información sobre la casa\n\nNecesito un espacio para una plenaria en formato escolar, con montaje de escenografía (escenario, pantallas, etc). El espacio deberá ser privativo pues todo el contenido del evento es confidencial\n\nNecesito un espacio adicional para el montaje de 10 stands pequeños. Si hay habitaciones separadas será mejor.\n\nPor favor, necesito que me pase el valor para el alquiler durante 06, 07, 08 y 09/05/2018, siendo 06 y 07/05 montaje y 08 y 09/05 evento\n\nJunto al valor, necesito la planta baja de la casa para que pueda desarrollar mejor mi proyecto\n\nPor favor, necesito el retorno aún hoy, con mucha urgencia',1,0,'2018-02-20 14:19:46',NULL),(548,240,503,'Hola Santiago. No sé que problema hubo que el mensaje no fue enviado. Te comentaba que estoy de vacaciones hasta el 28 de febrero y me resulta dificil armarte un presupuesto formal. El cocktail inxluye fingers, una cazuela, postre y bebidas libre ( con vino San Felipe) . El precio de $ 1000 es por cada ujo. No tenemos estacionamiento pero tenemos un acuerdo con uno que realiza 30% de descuento a dos cuadras . Igualmente el Salón tiene muy buen acceso con dos líneas de subte. Cuando sería el evwnto. Podes aguardar a mi regreso??',0,0,'2018-02-20 17:11:11','2018-02-20 17:11:11'),(549,234,531,'Marina cómo estás. Te confirmo la producción de fotos para ESTE VIERNES 23, POR LA MAÑANA (si podrás especificarme a que hora podríamos comenzar genial). Necesitaría saber que disponibilidad tenes para que los fotógrafos vayan a ver el lugar previo al viernes, así les comunico. Gracias! ',0,0,'2018-02-20 17:32:06','2018-02-20 17:32:06'),(550,234,281,'Hola Victoria, buenas tardes.\nTe pido por favor que confirmes el evento al presupuesto que te he enviado, de otro modo no quedará confirmado.\n\nMuchas gracias!\nSaludos,',0,0,'2018-02-20 18:00:50','2018-02-20 18:00:50'),(551,234,1,'El dueño del espacio envio una propuesta para el evento.',1,0,'2018-02-20 18:01:17','2018-02-20 18:01:17'),(552,244,542,'Hola! Como estas?\nMi nombre es Milagros Silva y trabajo en la consultora MCG.\nMe interesa tu espacio para hacer una reunión de trabajo el dia viernes 2/3.\nTe hago una consulta, ustedes tienen servicio de catering? O contratamos uno de afuera?\nEntiendo que proyector y pantalla hay en el salon. ¿Es asi?\n\nAguardo tus comentarios.\nGracias,\nMilagros.',1,0,