 para bloquear la fecha\nEl 70% restante se abonara en su totalidad 7 días hábiles antes de realizarse el evento.\n',1,0,0),(28,208,2,50,'2017-06-01 22:40:30','2017-06-01 22:40:30',68,8,283,10000.00,10000.00,1800.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,1800,10000,'enviada','2018-01-29 13:48:55','2018-01-29 13:48:55','Hola etUbicado en la Terraza de un Petit Hotel en la mejor zona de Palermo Soho, se encuentra este moderno deck con hidromasaje y poltronas, parrilla y muebles de patio, perfecto para cocktails y reuniones distendidas. Cuenta con un espacio cerrado con ventanales y mesas de trabajo, con wifi de alta velocidad incluido, ideal para jornadas de capacitación o reuniones de trabajo en un espacio privado y con luz natural.\n',1,0,0),(29,161,1,10,'10/11/2017 09:00 am','11/11/2017 05:00 am',9,8,25,10000.00,0.00,0.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,NULL,NULL,'enviada','2018-01-29 14:00:46','2018-01-29 14:00:46','añlsdkjañlsdkñalsdjkñasl',1,0,0),(33,209,1,50,'2017-06-01','2017-06-01',513,8,25,100000.00,0.00,0.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,NULL,NULL,'enviada','2018-01-29 14:19:21','2018-01-29 14:19:21','Tenes que pagar todo! \n',1,0,0),(34,229,3,7,'2017-06-01','2017-06-01',16,528,44,14000.00,0.00,0.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,NULL,14000,'enviada','2018-02-07 18:19:21','2018-02-07 18:19:21','14.000 + IVA Media Jornada (Para sesiones de hasta 6 horas) \n18.000 + IVA Jornada completa (Para sesiones de hasta 12 horas) \n\nSumado a esto 1 adicional de $800+IVA (Media Jornada) o $1200+IVA (Jornada completa) por concepto de persona de limpieza quien estará presente durante la jornada asistiendolos. \n\nEn el caso que sean más de 16 personas en la parte técnica usualmente solicitamos un cheque por valor de $20.000 en concepto de posibles daños o rupturas que será devuelto al finalizar la jornada, después de verificar que la sala se encuentra en el mismo estado en que se entregó. ',1,0,0),(35,106,1,10,'27/10/2017 09:00 am','27/10/2017 18:30 p