os pagos efectuados en cheques deberán ser de cuentas personales al día, tendrán que estar a la orden de la empresa y ser acreditados como mínimo siete (7) días antes de la fecha del evento.\n6. OTROS SERVICIOS: Todos los servicios adicionales como: catering, disc jockey, ambientación, foto y video, deberán ser contratados con los proveedores sugeridos por EVENTOS BUENOS AYRES.  El alquiler de sillas Tiffany es exclusivo de Eventos Buenos Ayres.-\n8.  DEL SERVICIO: Eventos nocturnos hasta las 6:00 am y por Eventos de día, consultar.\n9. IMPUESTOS AADI CAPIF y SADAIC: Dichos impuestos no se encuentran incluidos en el costo del salón. Deberán ser abonados 10 días antes del evento en el cierre final, al precio vigente. \n10. Los precios no incluyen IVA.',1,0,0),(41,273,3,8,'2017-06-01','2017-06-01',23,562,52,2800.00,0.00,0.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,NULL,2800,'enviada','2018-04-11 17:45:34','2018-04-11 17:45:34',NULL,1,0,0),(42,316,2,50,'2017-06-01','2017-06-01',64,607,95,15000.00,0.00,0.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,NULL,15000,'enviada','2018-06-01 19:31:01','2018-06-01 19:31:01',NULL,1,0,0),(43,301,1,2,'2017-06-01','2017-06-01',17,68,49,20000.00,0.00,0.00,'2017-06-01',0.00,NULL,NULL,NULL,NULL,NULL,20000,'enviada','2018-06-10 14:02:08','2018-06-10 14:02:08','- Los horarios acordados deben ser respetados\n- No se permiten fiestas o música fuerte\n- Solo está permitido fumar en el exterior',1,0,0);
